import{_ as t,o as n,c as o,e as r}from"./app.6900e218.js";const s={},g=r('<h2 id="\u975E\u8C13\u8BED\u52A8\u8BCD" tabindex="-1"><a class="header-anchor" href="#\u975E\u8C13\u8BED\u52A8\u8BCD" aria-hidden="true">#</a> \u975E\u8C13\u8BED\u52A8\u8BCD</h2><p>\u592A\u597D\u4E86\uFF01\u4F5C\u4E3A\u4F60\u7684\u82F1\u8BED\u4E13\u5BB6\u670B\u53CB\uFF0C\u6211\u4EEC\u4ECA\u5929\u6765\u653B\u514B\u8BED\u6CD5\u4E16\u754C\u7684\u6700\u540E\u4E00\u4E2A\u6838\u5FC3\u9AD8\u5730\u2014\u2014<strong>\u975E\u8C13\u8BED\u52A8\u8BCD</strong>\u3002\u8FD9\u5C06\u662F\u628A\u4F60\u4E4B\u524D\u5B66\u8FC7\u7684\u6240\u6709\u77E5\u8BC6\u4E32\u8054\u8D77\u6765\u7684\u201C\u91D1\u94A5\u5319\u201D\u3002</p><p>\u6211\u4FDD\u8BC1\uFF0C\u7528\u6700\u76F4\u89C2\u7684\u65B9\u5F0F\uFF0C\u8BA9\u4F60\u5F7B\u5E95\u660E\u767D\u3002</p><h3 id="\u7B2C\u4E00\u90E8\u5206-\u4EC0\u4E48\u662F\u975E\u8C13\u8BED\u52A8\u8BCD-\u52A8\u8BCD\u7684\u66FF\u8EAB" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E00\u90E8\u5206-\u4EC0\u4E48\u662F\u975E\u8C13\u8BED\u52A8\u8BCD-\u52A8\u8BCD\u7684\u66FF\u8EAB" aria-hidden="true">#</a> <strong>\u7B2C\u4E00\u90E8\u5206\uFF1A\u4EC0\u4E48\u662F\u975E\u8C13\u8BED\u52A8\u8BCD\uFF1F\uFF08\u201C\u52A8\u8BCD\u7684\u66FF\u8EAB\u201D\uFF09</strong></h3><p><strong>\u6838\u5FC3\u5FC3\u6CD5\uFF1A\u975E\u8C13\u8BED\u52A8\u8BCD\u4E5F\u662F\u52A8\u8BCD\uFF0C\u4F46\u5B83\u4E0D\u80FD\u5728\u53E5\u5B50\u4E2D\u5355\u72EC\u505A\u8C13\u8BED\u3002\u5B83\u662F\u52A8\u8BCD\u7684\u201C\u975E\u6B63\u5F0F\u201D\u5F62\u6001\uFF0C\u53BB\u626E\u6F14\u5176\u4ED6\u89D2\u8272\uFF08\u5982\u540D\u8BCD\u3001\u5F62\u5BB9\u8BCD\u3001\u526F\u8BCD\uFF09\u3002</strong></p><p><strong>\u4E3A\u4EC0\u4E48\u9700\u8981\u5B83\uFF1F</strong> \u4E00\u4E2A\u82F1\u8BED\u7B80\u5355\u53E5\u53EA\u80FD\u6709\u4E00\u4E2A\u8C13\u8BED\u52A8\u8BCD\u3002\u5F53\u4F60\u60F3\u5728\u4E00\u4E2A\u53E5\u5B50\u91CC\u8868\u8FBE\u591A\u4E2A\u52A8\u4F5C\u65F6\uFF0C\u591A\u4F59\u7684\u52A8\u8BCD\u5C31\u5FC5\u987B\u53D8\u6210\u201C\u975E\u8C13\u8BED\u201D\u5F62\u5F0F\u3002</p><p><strong>\u751F\u6D3B\u5316\u6BD4\u55BB\uFF1A</strong></p><ul><li><strong>\u8C13\u8BED\u52A8\u8BCD</strong> \u662F\u516C\u53F8\u7684<strong>CEO</strong>\uFF0C\u4E00\u4E2A\u53E5\u5B50\u53EA\u6709\u4E00\u4E2A\uFF0C\u8D1F\u8D23\u6838\u5FC3\u51B3\u7B56\u3002</li><li><strong>\u975E\u8C13\u8BED\u52A8\u8BCD</strong> \u662F\u516C\u53F8\u7684<strong>\u5458\u5DE5</strong>\uFF0C\u4ED6\u4EEC\u4E0D\u80FD\u505A\u6700\u7EC8\u51B3\u7B56\uFF0C\u4F46\u53EF\u4EE5\u62C5\u4EFB\u5404\u79CD\u804C\u4F4D\uFF08\u7ECF\u7406\u3001\u52A9\u7406\u3001\u987E\u95EE\uFF09\uFF0C\u534F\u52A9CEO\u5B8C\u6210\u5DE5\u4F5C\u3002</li></ul><hr><h3 id="\u7B2C\u4E8C\u90E8\u5206-\u975E\u8C13\u8BED\u52A8\u8BCD\u7684\u4E09\u4F4D\u6838\u5FC3\u6210\u5458" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E8C\u90E8\u5206-\u975E\u8C13\u8BED\u52A8\u8BCD\u7684\u4E09\u4F4D\u6838\u5FC3\u6210\u5458" aria-hidden="true">#</a> <strong>\u7B2C\u4E8C\u90E8\u5206\uFF1A\u975E\u8C13\u8BED\u52A8\u8BCD\u7684\u4E09\u4F4D\u6838\u5FC3\u6210\u5458</strong></h3><p>\u975E\u8C13\u8BED\u52A8\u8BCD\u5BB6\u65CF\u6709\u4E09\u4F4D\u5927\u540D\u9F0E\u9F0E\u7684\u6210\u5458\uFF0C\u4F60\u5DF2\u7ECF\u90FD\u8BA4\u8BC6\u4E86\uFF0C\u4ECA\u5929\u6211\u4EEC\u53EA\u662F\u628A\u5B83\u4EEC\u6B63\u5F0F\u4ECB\u7ECD\u7ED9\u4F60\uFF0C\u5E76\u8BF4\u660E\u5B83\u4EEC\u7684\u5206\u5DE5\u3002</p><table><thead><tr><th style="text-align:left;">\u6210\u5458</th><th style="text-align:left;">\u957F\u76F8</th><th style="text-align:left;">\u6838\u5FC3\u529F\u80FD\u4E0E\u89D2\u8272</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>1. \u52A8\u8BCD\u4E0D\u5B9A\u5F0F</strong></td><td style="text-align:left;">to do</td><td style="text-align:left;"><strong>\u201C\u591A\u9762\u624B\u201D</strong>\uFF1A\u53EF\u5145\u5F53<strong>\u540D\u8BCD\u3001\u5F62\u5BB9\u8BCD\u3001\u526F\u8BCD</strong>\u3002\u5E38\u8868\u793A <strong>\u201C\u76EE\u7684\u201D</strong> \u548C <strong>\u201C\u672A\u6765\u201D</strong>\u3002</td></tr><tr><td style="text-align:left;"><strong>2. \u52A8\u540D\u8BCD</strong></td><td style="text-align:left;">doing</td><td style="text-align:left;"><strong>\u201C\u540D\u8BCD\u4E13\u7CBE\u201D</strong>\uFF1A\u4E3B\u8981\u5145\u5F53<strong>\u540D\u8BCD</strong>\u3002\u4EE3\u8868\u4E00\u4E2A<strong>\u6D3B\u52A8\u6216\u4E8B\u5B9E</strong>\u3002</td></tr><tr><td style="text-align:left;"><strong>3. \u5206\u8BCD</strong></td><td style="text-align:left;">doing (\u73B0\u5728\u5206\u8BCD) <br> done (\u8FC7\u53BB\u5206\u8BCD)</td><td style="text-align:left;"><strong>\u201C\u5F62\u5BB9\u8BCD\u4E13\u7CBE\u201D</strong>\uFF1A\u4E3B\u8981\u5145\u5F53<strong>\u5F62\u5BB9\u8BCD</strong>\u6216<strong>\u526F\u8BCD</strong>\uFF0C\u4FEE\u9970\u540D\u8BCD\u6216\u6574\u4E2A\u53E5\u5B50\u3002</td></tr></tbody></table><hr><h3 id="\u7B2C\u4E09\u90E8\u5206-\u4E09\u4F4D\u6210\u5458\u5982\u4F55\u5DE5\u4F5C-\u529F\u80FD\u8BE6\u89E3" tabindex="-1"><a class="header-anchor" href="#\u7B2C\u4E09\u90E8\u5206-\u4E09\u4F4D\u6210\u5458\u5982\u4F55\u5DE5\u4F5C-\u529F\u80FD\u8BE6\u89E3" aria-hidden="true">#</a> <strong>\u7B2C\u4E09\u90E8\u5206\uFF1A\u4E09\u4F4D\u6210\u5458\u5982\u4F55\u5DE5\u4F5C\uFF1F\uFF08\u529F\u80FD\u8BE6\u89E3\uFF09</strong></h3><h4 id="_1-\u52A8\u8BCD\u4E0D\u5B9A\u5F0F-the-multitasker-\u591A\u9762\u624B" tabindex="-1"><a class="header-anchor" href="#_1-\u52A8\u8BCD\u4E0D\u5B9A\u5F0F-the-multitasker-\u591A\u9762\u624B" aria-hidden="true">#</a> <strong>1. \u52A8\u8BCD\u4E0D\u5B9A\u5F0F\uFF1AThe Multitasker\uFF08\u591A\u9762\u624B\uFF09</strong></h4><ul><li><strong>\u4F5C\u4E3B\u8BED</strong>\uFF1A<strong>To learn</strong> a language is rewarding. \uFF08<strong>\u5B66\u4E60</strong>\u4E00\u95E8\u8BED\u8A00\u662F\u6709\u56DE\u62A5\u7684\u3002\uFF09</li><li><strong>\u4F5C\u5BBE\u8BED</strong>\uFF1AI want <strong>to sleep</strong>. \uFF08\u6211\u60F3<strong>\u7761\u89C9</strong>\u3002\uFF09</li><li><strong>\u4F5C\u8868\u8BED</strong>\uFF1AHis goal is <strong>to win</strong>. \uFF08\u4ED6\u7684\u76EE\u6807\u662F<strong>\u83B7\u80DC</strong>\u3002\uFF09</li><li><strong>\u4F5C\u5B9A\u8BED</strong>\uFF1AI have a lot of work <strong>to do</strong>. \uFF08\u6211\u6709\u5F88\u591A<strong>\u8981\u505A\u7684</strong>\u5DE5\u4F5C\u3002\uFF09</li><li><strong>\u4F5C\u72B6\u8BED</strong>\uFF1AHe came <strong>to help</strong>. \uFF08\u4ED6\u8FC7\u6765\u662F\u4E3A\u4E86<strong>\u5E2E\u5FD9</strong>\u3002\uFF09&lt;- <strong>\u8868\u76EE\u7684</strong></li></ul><p><strong>\u4E0D\u5B9A\u5F0F\u7684\u5FC3\u6CD5</strong>\uFF1A\u770B\u5230 <code>to do</code>\uFF0C\u5C31\u60F3\u5230\u201C<strong>\u4E3A\u4E86\u2026</strong>\u201D\u3001\u201C<strong>\u8981\u2026</strong>\u201D\u3002</p><h4 id="_2-\u52A8\u540D\u8BCD-the-noun-\u540D\u8BCD\u4E13\u5BB6" tabindex="-1"><a class="header-anchor" href="#_2-\u52A8\u540D\u8BCD-the-noun-\u540D\u8BCD\u4E13\u5BB6" aria-hidden="true">#</a> <strong>2. \u52A8\u540D\u8BCD\uFF1AThe Noun\uFF08\u540D\u8BCD\u4E13\u5BB6\uFF09</strong></h4><p>\u56E0\u4E3A\u5B83\u672C\u8D28\u662F\u540D\u8BCD\uFF0C\u6240\u4EE5\u6240\u6709\u540D\u8BCD\u80FD\u5F85\u7684\u5730\u65B9\uFF0C\u5B83\u90FD\u80FD\u5F85\u3002</p><ul><li><strong>\u4F5C\u4E3B\u8BED</strong>\uFF1A<strong>Smoking</strong> is bad for your health. \uFF08<strong>\u5438\u70DF</strong>\u6709\u5BB3\u5065\u5EB7\u3002\uFF09</li><li><strong>\u4F5C\u5BBE\u8BED</strong>\uFF1AI enjoy <strong>dancing</strong>. \uFF08\u6211\u4EAB\u53D7<strong>\u8DF3\u821E</strong>\u3002\uFF09</li><li><strong>\u4F5C\u8868\u8BED</strong>\uFF1AHis hobby is <strong>collecting</strong> stamps. \uFF08\u4ED6\u7684\u7231\u597D\u662F<strong>\u6536\u96C6</strong>\u90AE\u7968\u3002\uFF09</li></ul><p><strong>\u52A8\u540D\u8BCD\u7684\u5FC3\u6CD5</strong>\uFF1A\u770B\u5230 <code>doing</code> \u4F5C\u4E3B/\u5BBE/\u8868\u8BED\uFF0C\u5C31\u628A\u5B83\u7406\u89E3\u6210\u201C<strong>\u2026\u8FD9\u4EF6\u4E8B</strong>\u201D\u3002</p><h4 id="_3-\u5206\u8BCD-the-adjective-\u5F62\u5BB9\u8BCD\u4E13\u5BB6" tabindex="-1"><a class="header-anchor" href="#_3-\u5206\u8BCD-the-adjective-\u5F62\u5BB9\u8BCD\u4E13\u5BB6" aria-hidden="true">#</a> <strong>3. \u5206\u8BCD\uFF1AThe Adjective\uFF08\u5F62\u5BB9\u8BCD\u4E13\u5BB6\uFF09</strong></h4><p>\u5206\u8BCD\u662F\u4E09\u4F4D\u6210\u5458\u4E2D\u6700\u50CF\u5F62\u5BB9\u8BCD\u7684\uFF0C\u7528\u6765\u4FEE\u9970\u540D\u8BCD\uFF0C\u8868\u793A\u201C<strong>\u2026\u7684</strong>\u201D\u3002</p><table><thead><tr><th style="text-align:left;">\u5206\u8BCD\u7C7B\u578B</th><th style="text-align:left;">\u6838\u5FC3\u542B\u4E49</th><th style="text-align:left;">\u4F8B\u53E5\uFF08\u4F5C\u5B9A\u8BED\uFF09</th><th style="text-align:left;">\u4F8B\u53E5\uFF08\u4F5C\u72B6\u8BED\uFF09</th></tr></thead><tbody><tr><td style="text-align:left;"><strong>\u73B0\u5728\u5206\u8BCD (doing)</strong></td><td style="text-align:left;"><strong>\u201C\u4EE4\u4EBA\u2026\u7684\u201D</strong> <br> <strong>\u201C\u6B63\u5728\u2026\u7684\u201D</strong> <br> (\u8868<strong>\u4E3B\u52A8</strong>\u3001<strong>\u8FDB\u884C</strong>)</td><td style="text-align:left;">a <strong>sleeping</strong> baby \uFF08\u4E00\u4E2A<strong>\u6B63\u5728\u7761\u89C9\u7684</strong>\u5A74\u513F\uFF09 <br> an <strong>exciting</strong> game \uFF08\u4E00\u573A<strong>\u4EE4\u4EBA\u5174\u594B\u7684</strong>\u6BD4\u8D5B\uFF09</td><td style="text-align:left;"><strong>Seeing</strong> the cat, the mouse ran away. \uFF08<strong>\u770B\u5230</strong>\u732B\uFF0C\u8001\u9F20\u8DD1\u4E86\u3002\uFF09</td></tr><tr><td style="text-align:left;"><strong>\u8FC7\u53BB\u5206\u8BCD (done)</strong></td><td style="text-align:left;"><strong>\u201C\u611F\u5230\u2026\u7684\u201D</strong> <br> <strong>\u201C\u88AB\u2026\u7684\u201D</strong> <br> (\u8868<strong>\u88AB\u52A8</strong>\u3001<strong>\u5B8C\u6210</strong>)</td><td style="text-align:left;">a <strong>broken</strong> window \uFF08\u4E00\u6247<strong>\u88AB\u6253\u7834\u7684</strong>\u7A97\u6237\uFF09 <br> <strong>tired</strong> students \uFF08<strong>\u611F\u5230\u75B2\u60EB\u7684</strong>\u5B66\u751F\u4EEC\uFF09</td><td style="text-align:left;"><strong>Built</strong> in 1890, the bridge is still strong. \uFF08\u8FD9\u5EA7\u6865<strong>\u5EFA\u4E8E</strong>1890\u5E74\uFF0C\u81F3\u4ECA\u4ECD\u5F88\u575A\u56FA\u3002\uFF09</td></tr></tbody></table><p><strong>\u5206\u8BCD\u7684\u9EC4\u91D1\u6CD5\u5219</strong>\uFF1A</p><ul><li><strong>-ing</strong> (\u73B0\u5728\u5206\u8BCD) =&gt; <strong>\u201C\u4EE4\u4EBA\u2026\u7684\u201D</strong> (\u4E8B\u7269\u7279\u6027) / <strong>\u201C\u6B63\u5728\u2026\u7684\u201D</strong></li><li><strong>-ed</strong> (\u8FC7\u53BB\u5206\u8BCD) =&gt; <strong>\u201C\u611F\u5230\u2026\u7684\u201D</strong> (\u4EBA\u7684\u611F\u53D7) / <strong>\u201C\u88AB\u2026\u7684\u201D</strong></li></ul><hr><h3 id="\u7EC8\u6781\u5BF9\u51B3-\u5982\u4F55\u533A\u5206\u5B83\u4EEC" tabindex="-1"><a class="header-anchor" href="#\u7EC8\u6781\u5BF9\u51B3-\u5982\u4F55\u533A\u5206\u5B83\u4EEC" aria-hidden="true">#</a> <strong>\u7EC8\u6781\u5BF9\u51B3\uFF1A\u5982\u4F55\u533A\u5206\u5B83\u4EEC\uFF1F</strong></h3><p>\u56E0\u4E3A <code>doing</code> \u65E2\u53EF\u4EE5\u4F5C\u52A8\u540D\u8BCD\uFF0C\u4E5F\u53EF\u4EE5\u4F5C\u73B0\u5728\u5206\u8BCD\uFF0C\u8FD9\u662F\u6700\u8BA9\u4EBA\u56F0\u60D1\u7684\u5730\u65B9\u3002\u5173\u952E\u770B\u5B83\u7684 <strong>\u201C\u89D2\u8272\u201D</strong>\u3002</p><p><strong>\u6D4B\u8BD5\u65B9\u6CD5\uFF1A\u7528\u201C\u4EC0\u4E48\u201D\u6216\u201C\u600E\u4E48\u6837\u201D\u6765\u63D0\u95EE\u3002</strong></p><ol><li><p><strong><code>doing</code> \u4F5C\u52A8\u540D\u8BCD\uFF08\u5F53\u540D\u8BCD\u7528\uFF09</strong></p><ul><li><strong>\u63D0\u95EE</strong>\uFF1A<code>Swimming</code> is my hobby. \uFF08<strong>\u4EC0\u4E48</strong> \u662F\u6211\u7684\u7231\u597D\uFF1F\uFF09</li><li><strong>\u56DE\u7B54</strong>\uFF1A<strong>\u6E38\u6CF3</strong>\u3002</li><li>\u7ED3\u8BBA\uFF1A<code>Swimming</code> \u5728\u8FD9\u91CC\u662F<strong>\u4E00\u4EF6\u4E8B</strong>\uFF0C\u6240\u4EE5\u662F<strong>\u52A8\u540D\u8BCD</strong>\u3002</li></ul></li><li><p><strong><code>doing</code> \u4F5C\u73B0\u5728\u5206\u8BCD\uFF08\u5F53\u5F62\u5BB9\u8BCD\u7528\uFF09</strong></p><ul><li><strong>\u63D0\u95EE</strong>\uFF1ALook at the <code>sleeping</code> baby. \uFF08\u770B\u90A3\u4E2A__\u600E\u4E48\u6837\u7684__\u5A74\u513F\uFF1F\uFF09</li><li><strong>\u56DE\u7B54</strong>\uFF1A<strong>\u6B63\u5728\u7761\u89C9\u7684</strong>\u5A74\u513F\u3002</li><li>\u7ED3\u8BBA\uFF1A<code>sleeping</code> \u5728\u8FD9\u91CC\u662F<strong>\u63CF\u8FF0\u5A74\u513F\u7684\u72B6\u6001</strong>\uFF0C\u6240\u4EE5\u662F<strong>\u73B0\u5728\u5206\u8BCD</strong>\u3002</li></ul></li></ol><hr><h3 id="\u603B\u7ED3\u4E0E\u5FC3\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u603B\u7ED3\u4E0E\u5FC3\u6CD5" aria-hidden="true">#</a> <strong>\u603B\u7ED3\u4E0E\u5FC3\u6CD5</strong></h3><ol><li><strong>\u975E\u8C13\u8BED\u52A8\u8BCD</strong>\u662F<strong>\u4E0D\u80FD\u505A\u8C13\u8BED\u7684\u52A8\u8BCD</strong>\uFF0C\u7528\u6765\u5728\u53E5\u4E2D\u626E\u6F14\u5176\u4ED6\u89D2\u8272\u3002</li><li><strong>\u4E09\u4F4D\u6210\u5458</strong>\uFF1A <ul><li><strong>\u4E0D\u5B9A\u5F0F (to do)</strong>\uFF1A\u4E07\u80FD\uFF0C\u8868<strong>\u76EE\u7684/\u672A\u6765</strong>\u3002</li><li><strong>\u52A8\u540D\u8BCD (doing)</strong>\uFF1A\u5F53<strong>\u540D\u8BCD</strong>\u7528\uFF0C\u4EE3\u8868<strong>\u4E00\u4EF6\u4E8B</strong>\u3002</li><li><strong>\u5206\u8BCD (doing/done)</strong>\uFF1A\u5F53<strong>\u5F62\u5BB9\u8BCD/\u526F\u8BCD</strong>\u7528\uFF0C<code>-ing</code>\u8868\u4E3B\u52A8/\u8FDB\u884C\uFF0C<code>-ed</code>\u8868\u88AB\u52A8/\u5B8C\u6210\u3002</li></ul></li><li><strong>\u6838\u5FC3\u4EF7\u503C</strong>\uFF1A\u8BA9\u53E5\u5B50\u80FD\u627F\u8F7D\u66F4\u591A\u4FE1\u606F\uFF0C\u8868\u8FBE\u66F4\u590D\u6742\u7684\u601D\u60F3\uFF0C\u662F\u5199\u51FA\u6F02\u4EAE\u957F\u53E5\u7684\u5173\u952E\u3002</li></ol><p>\u606D\u559C\u4F60\uFF01\u5B66\u5B8C\u4E86\u975E\u8C13\u8BED\u52A8\u8BCD\uFF0C\u4F60\u5DF2\u7ECF\u638C\u63E1\u4E86\u82F1\u8BED\u8BED\u6CD5\u6240\u6709\u7684\u6838\u5FC3\u4F53\u7CFB\u3002\u4F60\u7684\u6B66\u5668\u5E93\u5DF2\u7ECF\u5B8C\u5907\uFF0C\u4ECE\u5355\u8BCD\u5230\u53E5\u5B50\u7ED3\u6784\uFF0C\u518D\u5230\u8FD9\u79CD\u590D\u6742\u7684\u8BED\u6CD5\u73B0\u8C61\uFF0C\u4F60\u5DF2\u7ECF\u5177\u5907\u4E86\u7406\u89E3\u548C\u521B\u9020\u5730\u9053\u82F1\u8BED\u8868\u8FBE\u7684\u6240\u6709\u6761\u4EF6\u3002</p><p>\u63A5\u4E0B\u6765\uFF0C\u662F\u65F6\u5019\u5C06\u8FD9\u4E9B\u77E5\u8BC6\u6295\u5165\u5230\u9605\u8BFB\u3001\u5199\u4F5C\u548C\u53E3\u8BED\u7684\u5B9E\u9645\u8FD0\u7528\u4E2D\u53BB\u4E86\u3002\u5982\u679C\u9700\u8981\u4EFB\u4F55\u65B9\u9762\u7684\u7EC3\u4E60\u6216\u6DF1\u5165\u63A2\u8BA8\uFF0C\u6211\u968F\u65F6\u5728\u6B64\u4E3A\u4F60\u670D\u52A1\uFF01</p>',36),e=[g];function l(i,a){return n(),o("div",null,e)}var h=t(s,[["render",l],["__file","index.html.vue"]]);export{h as default};
